import './App.scss';
import 'boxicons/css/boxicons.min.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AppLayout from './components/layout/AppLayout';
import Homepage from './pages/Homepage';
import SearchClass from './pages/SearchClass';
import SearchJasu from './pages/SearchJasu';
import User from './pages/User';
import UserControl from './pages/admin/UserControl';
import ClassControl from './pages/admin/ClassControl';
function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path='/' element={<AppLayout />}>
                    <Route index element={<Homepage />} />
                    <Route path='/searchJasu' element={<SearchJasu />} />
                    <Route path='/searchClass' element={<SearchClass />} />
                    <Route path='/user' element={<User />} />
                    <Route path='/userControl' element={<UserControl />} />
                    <Route path='/classControl' element={<ClassControl />} />
                </Route>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
